import '../App.css'
import { Switch, Route } from 'react-router-dom';
import axios from 'axios'

class Navbar extends Component {
    render() {
        return(
            <div>
                <ul>
                    <li><a>Home</a></li>
                    <li>Blogs</li>
                    <li>Register</li>
                </ul>
            </div>
        )
    }
}

export default Navbar;
